pragma solidity ^0.8.7;

contract Read {
    function read()
        external
        pure
        returns (address[] memory a, address[] memory b)
    {
        a = new address[](1);
        a[0] = address(0xCDf41a135C65d0013393B3793F92b4FAF31032d0);

        b = new address[](2);
        b[0] = address(0);
        b[1] = address(0x5ce6047a715B1919A58C549E6FBc1921B4d9287D);
    }
}
